import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact"];
export default function Header() {
  return (
    <nav class="navbar fixed-top navbar-expand-lg toggle-height" id="global-nav">
      <div class="container">
        <a class="navbar-brand scrollN" href="/">Prabhakar Mishra</a>
        {services_array.map(service => (
          <Link href={`/${service}`}>
            <button style={linkStyle}>
              <span>{service}</span>
            </button>
          </Link>
        ))}
      </div>
    </nav>
  )
}
